    console.log(id,name,email,number,address,dob)
    return(
        <div>
           <h3>id:{id}</h3>
           <h3>name:{id}</h3>
           <h3>id:{id}</h3>
           <h3>id:{id}</h3>
        </div>
    )
}

export default Profile
